import React from 'react';

const Hero = () => {
  const handleBookNow = () => {
    alert('Booking functionality would be implemented here');
  };

  return (
    <div style={styles.container}>
      {/* First Hero Section */}
      <section style={styles.heroSection}>
        <div style={styles.heroContent}>
          <h1 style={styles.mainTitle}>Let the world know about your brand!</h1>
          <p style={styles.subTitle}>Personalized PR packages for every industry</p>
          <button style={styles.bookNowButton} onClick={handleBookNow}>
            Book Now
          </button>
          <div style={styles.features}>
            <p style={styles.featureItem}>✓ Businessed Outpension within 48 HOURS</p>
            <p style={styles.featureItem}>✓ Major media sites</p>
          </div>
        </div>
      </section>

      {/* Second Hero Section */}
      <section style={styles.secondSection}>
        <div style={styles.secondContent}>
          <h2 style={styles.secondTitle}>Deals and Offers</h2>
          <p style={styles.secondText}>Let the whole city hear about your brand!</p>
          <button style={styles.secondButton}>Book Now</button>
          <p style={styles.secondSubText}>Get an identity at the opport</p>
        </div>
      </section>

      {/* Third Hero Section */}
      <section style={styles.thirdSection}>
        <div style={styles.thirdContent}>
          <h2 style={styles.thirdTitle}>Get Result-Based Digital Marketing Packages for Your Success!</h2>
          <button style={styles.thirdButton}>Book Now</button>
          <p style={styles.chatText}>Online Chat with expert</p>
        </div>
      </section>
    </div>
  );
};

